import React from "react";
import { InboxItem }from "./InboxItem";

const Inbox = ({token, posts}) => {

    console.log(posts);
    return (<>
        <div>
            <h2>Messages</h2>
            {posts.map((post) => {
                return <InboxItem token={token} post={post}/>
            })}
        </div>
    </>)
}

export default Inbox;
